import React from 'react';
import {Link} from 'react-router-dom';

function HomePage() {
    return (
        <header>
            <div>
                <h2>
                    Welcome to LegitMart!
                </h2>
                <p>
                    Click the above links to get started! 
                    <br></br>
                    Click <Link to="/">Home</Link> to return to this page! 
                    <br></br>
                    Click <Link to="/order">Order</Link> to place an order! 
                    <br></br>
                    If you're a first time shopper, click <Link to="/register">Register</Link> to make an account!
                </p>
            </div>
        </header>
    );
}

export default HomePage;
